import React from "react";

import { Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

import "./Style.css";

export default function Service() {
  return (
    <div>
      <Container id="service">
        <div class=" d-flex justify-content-center align-items-center">
          <h3 class="badge bg-primary  ">Flex item 1</h3>
          <h3 class="badge bg-primary">Flex item 2</h3>
          <h3 class="badge bg-primary">Flex item 3</h3>
        </div>

        <div className="d-flex justify-content-center mb-3" id="grid">
          <div className="p-2 mx-4 bd-highlight" id="box-1">
            Design Graphique
          </div>
          <div className="p-2 mx-4 bd-highlight" id="box-2">
            Digital Content
          </div>
          <div className="p-2 mx-4 bd-highlight" id="box-3">
            Site Web
          </div>
        </div>
      </Container>
    </div>
  );
}
